#### Key Equations and Code Snippets

1. **Method Overriding Example**
   ```java
   class Animal {
       void sound() {
           System.out.println("Animal makes a sound");
       }
   }

   class Dog extends Animal {
       @Override
       void sound() {
           System.out.println("Dog barks");
       }
   }
   ```

2. **Constructor Chaining Example**
   ```java
   class Vehicle {
       Vehicle() {
           System.out.println("Vehicle is created");
       }
   }

   class Car extends Vehicle {
       Car() {
           super();
           System.out.println("Car is created");
       }
   }
   ```

3. **Interface Implementation Example**
   ```java
   interface Drawable {
       void draw();
   }

   class Circle implements Drawable {
       public void draw() {
           System.out.println("Drawing a circle");
       }
   }
   ```

4. **Default Method in Interface**
   ```java
   interface Printable {
       default void print() {
           System.out.println("Printing...");
       }
   }
   ```

5. **Exception Handling Example**
   ```java
   try {
       int result = 10 / 0;
   } catch (ArithmeticException e) {
       System.out.println("Cannot divide by zero");
   }
   ```

6. **Type Casting Example**
   ```java
   class Animal {}
   class Dog extends Animal {}

   public class Main {
       public static void main(String[] args) {
           Animal animal = new Dog();
           if (animal instanceof Dog) {
               Dog dog = (Dog) animal;
           }
       }
   }
   ```

